description:
Hawaii's own Johnny Kapahaala suddenly finds himself in the cold mountains of Vermont, without his friends, his grandfather, and those famous Kauai waves! When some jealous locals make fun of his &quot;island style,&quot; he must find a way to unite his past and present -- which leads to some awesome snowboarding and a radical downhill race!


